PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX std: <http://data.ashrae.org/standard223#>
PREFIX brick: <https://brickschema.org/schema/Brick/>
SELECT ?zone ?propLabel ?alcEndpoint ?mpcEndpoint WHERE {
  # All zones (targets)
  ?zone a std:Zone .
  # Non-writable properties attached to the zone
  OPTIONAL {
    ?zone std:hasProperty ?prop .
    ?prop rdfs:label ?propLabel .
    FILTER NOT EXISTS { ?prop brick:writable true }
  }
  # External references that may hold ALC and MPC endpoints
  OPTIONAL {
    ?zone std:hasExternalReference ?extRef .
    OPTIONAL { ?extRef brick:source ?alcEndpoint . }
    OPTIONAL { ?extRef brick:endpoint ?alcEndpoint . }
    OPTIONAL { ?extRef brick:mpc_db_name ?mpcEndpoint . }
  }
}
ORDER BY ?zone ?propLabel

